import React, { useEffect } from "react";


function Home() {

    useEffect(()=>{
         fetch('https://lo')
         .then((response)=>{
            console.log(response)
         })
         .catch((e)=>{
            console.log(e);
         })
    },[])

  return (
    <div><h1>homepage</h1></div>
  )
}
export default Home;
